import React from 'react'
import {Route , Redirect} from 'react-router-dom'
// import * as isAuth from '../functions/isAuth' //return boolean

export default function PrivateRoute({component , isAuth,...rest}) {
    // isAuth() === true ? console.log('auth') : console.log('not auth')
    isAuth();
    console.log(isAuth)
    return (
        <Route
            {...rest}
            render = {() => isAuth === true ? 
                component
                : <Redirect to="/login" />
            }
        />
    )
}
